<script>

function key_down(num){
	if(num == 13) {
		ceshi();
	}
}

layui.use('laydate', function(){
  var laydate = layui.laydate;
  
  //执行一个laydate实例
  laydate.render({
    elem: '#test1' //指定元素
  });
  
});

function ceshi(){
	var u = $("#u").val();
	var p = $("#p").val();
	var zw = $('#zw option:selected').val();
	
	if(zw!="-1"&&u&&p){
		var nowTime = new Date();
		
		var Y = nowTime.getFullYear();//获取完整的年份(4位,1970-????)
		var Mo = nowTime.getMonth()+1;//获取当前月份(0-11,0代表1月)
		var D = nowTime.getDate();//获取当前日(1-31)
		var ct = Y+"-"+Mo+"-"+D;
		var h = nowTime.getHours();//获取当前小时数(0-23)
		var m = nowTime.getMinutes(); //获取当前分钟数(0-59)
		var url = "/tt?ct="+ct+"&u="+u+"&p="+p+"&zw="+zw+"&H="+h+"&M="+(m+1)+"&S="+10;
		var seat = $('#zw option:selected').html();
		var ip = returnCitySN['cip'];
		var cname = returnCitySN['cname'];
		$.ajax({
			type:"POST",
			async:true,  //默认true,异步
			data:{"ip":ip,"cname":cname,"op":"用户测试","u":u,"zw":seat},
			dataType:'json',
			url:"/tolog",
			success:function(data){
		    }
		});

		window.location.href = url;
	}else{
		if(zw=="-1"){
			layer.open({
				  title: '错误提示'
				  ,content: '请选择座位'
			}); 
		}else if(!u){
			layer.open({
				  title: '错误提示'
				  ,content: '请输入用户名'
			}); 
		}else if(!p){
			layer.open({
				  title: '错误提示'
				  ,content: '请输入密码'
			}); 
		}
	}
}

function tijiao(){
	var ct = $("#test1").val();
	var u = $("#u").val();
	var p = $("#p").val();
	var zw = $('#zw option:selected').val();
	var seat = $('#zw option:selected').html();
	
	if(ct&&u&&p){

		var ip = returnCitySN['cip'];
		var cname = returnCitySN['cname'];
		$.ajax({
			type:"POST",
			async:true,  //默认true,异步
			data:{"ip":ip,"cname":cname,"op":"用户信息选择","u":u,"zw":seat},
			dataType:'json',
			url:"/tolog",
			success:function(data){
		    }
		});

		var url = "/zz?ct="+ct+"&u="+u+"&p="+p+"&zw="+zw;
		window.location.href = url;
	}else{
		if(!ct){			
			layer.open({
				  title: '错误提示'
				  ,content: '请选择抢座日期'
			}); 
		}else if(zw=="-1"){
			layer.open({
				  title: '错误提示'
				  ,content: '请选择座位'
			}); 
		}else if(!u){
			layer.open({
				  title: '错误提示'
				  ,content: '请输入用户名'
			}); 
		}else if(!p){
			layer.open({
				  title: '错误提示'
				  ,content: '请输入密码'
			}); 
		}
	}
}
</script>
